import AppLayout from '../component/AppLayout';
import Seo from '../component/Seo';

const Signup = () => {
  return (
    <>
      <Seo title="Sign up"></Seo>
      <AppLayout>회원가입 페이지</AppLayout>
    </>
  );
};

export default Signup;
